import React, { useState, useEffect } from 'react';
import axios from 'axios';

const News = () => {
    const [news, setNews] = useState([]);

    useEffect(() => {
        const fetchNews = async () => {
            try {
                const response = await axios.get('/api/news'); // Adjust the route according to your backend setup
                setNews(response.data.data);
            } catch (error) {
                console.error('Error fetching news:', error);
            }
        };
        fetchNews();
    }, []);

    return (
        <div>
            <h2>All News</h2>
            <ul>
                {news.map(item => (
                    <li key={item._id}>
                        {item.title}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default News;
